import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  text:{
    textAlign: "center",
    color: "black",
    fontSize: 50,
    fontWeight: "bold",
    marginBottom: 80,
  },
  layout: {
    justifyContent: "center",
    flex: 1,
    backgroundColor: "white",
  },
  textInput: {
    borderColor: "black",
    textAlign: "center",
    height:50,
    borderWidth: 2,
    fontSize: 16,
    color: "black",
    backgroundColor: "#f5dda9",
  },
  textField: {
    height: 70,
    textAlign: "center",
    justifyContent: "center",

  },
});

const buttons = StyleSheet.create({
  button1: {
    elevation: 8,
    backgroundColor: "#ffa600",
    marginRight: 50,
    marginLeft: 50,
    marginBottom: 5,
    borderRadius: 10,
    paddingVertical: 20,
    paddingHorizontal: 20,
  },
  button2: {
    backgroundColor: "#f5dda9",
    marginBottom: 5,
    marginRight: 5,
    borderRadius: 10,
    paddingVertical: 20,
    paddingHorizontal: 20,
  },
  buttontext:{
    textAlign: "center",
    color: "black",
    fontSize: 20,
    fontWeight: "bold",
  }


});

export {styles, buttons};
